#include <vector>
#include <cmath>

double poly(std::vector<double> xs, double x) {
    double sum = 0;
    for (int i = 0; i < xs.size(); i++) {
        sum += xs[i] * pow(x, i);
    }
    return sum;
}

double find_zero(std::vector<double> xs) {
    if (xs.size() % 2 != 0) {
        throw std::invalid_argument("The number of coefficients must be even.");
    }

    double largest_non_zero_coeff = 0;
    for (int i = 0; i < xs.size(); i++) {
        if (xs[i] != 0) {
            largest_non_zero_coeff = xs[i];
            break;
        }
    }

    return -largest_non_zero_coeff / xs[0];
}

#undef NDEBUG
#include<assert.h>
int main(){

    double solution;
    int ncoeff;
    for (int i=0;i<100;i++)
    {
        ncoeff = 2 * (1+rand()%4);
        vector<double> coeffs = {};
        for (int j=0;j<ncoeff;j++)
        {
            double coeff = -10+rand()%21;
            if (coeff == 0) coeff = 1;
            coeffs.push_back(coeff);
        }

        solution = find_zero(coeffs);
        assert (abs(poly(coeffs, solution))< 1e-3);
    }
}

