using namespace std;

int max_fill(vector<vector<int>> grid, int capacity) {
    int m = grid.size();
    int n = grid[0].size();
    vector<int> buckets(n, 0);
    int count = 0;
    while (true) {
        bool filled = false;
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (grid[i][j] == 1 && buckets[j] < capacity) {
                    buckets[j]++;
                    grid[i][j] = 0;
                    filled = true;
                }
            }
        }
        if (!filled) {
            break;
        }
        count++;
    }
    return count;
}

