int max_fill(std::vector<std::vector<int>>&& grid, int capacity) {
    int m = grid.size();
    int n = grid[0].size();
    std::vector<int> heights(n, 0);
    int result = 0;

    while (true) {
        int max_height = *std::max_element(heights.begin(), heights.end());
        if (max_height == 0) {
            break;
        }

        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (grid[i][j] == 1 && heights[j] > 0) {
                    grid[i][j] = 0;
                    heights[j]--;
                }
            }
        }

        result += max_height;
    }

    return result * capacity;
}

