#include <queue>
#include <bits/stdc++.h>
using namespace std;

#include <string>

std::string encode_cyclic(std::string s) {
    int l = s.length();
    int num = (l + 2) / 3;
    std::string output = "";
    for (int i = 0; i * 3 < l; i++) {
        std::string x = s.substr(i * 3, 3);
        if (x.length() == 3) {
            x = x.substr(1) + x[0];
        }
        output += x;
    }
    return output;
}

std::string decode_cyclic(std::string s) {
    std::string output = "";
    for (int i = 0; i < s.length(); i += 3) {
        std::string x = s.substr(i, 3);
        if (x.length() == 3) {
            x = x[2] + x.substr(0, 2);
        }
        output += x;
    }
    return output;
}

#undef NDEBUG
