#include <vector>
#include <algorithm>

std::vector<int> largest_smallest_integers(std::vector<int> lst) {
    std::vector<int> negatives;
    std::vector<int> positives;

    for (int num : lst) {
        if (num < 0) {
            negatives.push_back(num);
        } else if (num > 0) {
            positives.push_back(num);
        }
    }

    int max_negative = negatives.empty() ? 0 : *std::max_element(negatives.begin(), negatives.end());
    int min_positive = positives.empty() ? 0 : *std::min_element(positives.begin(), positives.end());

    return {max_negative, min_positive};
}

