int do_algebra(std::vector<std::string> operators, std::vector<int> operands) {
    std::unordered_map<std::string, int> precedence = {{"+", 1}, {"-", 1}, {"*", 2}, {"//", 2}, {"**", 3}};
    std::stack<std::string> stack;
    std::vector<std::string> output;

    auto apply_operator = [&](const std::string& op) {
        int b = std::stoi(stack.top());
        stack.pop();
        int a = std::stoi(stack.top());
        stack.pop();
        if (op == "+") stack.push(std::to_string(a + b));
        else if (op == "-") stack.push(std::to_string(a - b));
        else if (op == "*") stack.push(std::to_string(a * b));
        else if (op == "//") stack.push(std::to_string(a / b));
        else if (op == "**") stack.push(std::to_string(pow(a, b)));
    };

    for (size_t i = 0; i < operands.size(); i++) {
        output.push_back(std::to_string(operands[i]));
        if (i < operators.size()) {
            while (!stack.empty() && precedence[operators[i]] <= precedence[stack.top()]) {
                output.push_back(stack.top());
                stack.pop();
            }
            stack.push(operators[i]);
        }
    }

    while (!stack.empty()) {
        output.push_back(stack.top());
        stack.pop();
    }

    for (const std::string& token : output) {
        if (isdigit(token[0])) {
            stack.push(token);
        } else {
            apply_operator(token);
        }
    }

    return std::stoi(stack.top());
}

