bool is_prime(int n) {
    if (n <= 1) {
        return false;
    }
    for (int i = 2; i <= sqrt(n); i++) {
        if (n % i == 0) {
            return false;
        }
    }
    return true;
}

string words_in_sentence(string sentence) {
    vector<string> words;
    string word = "";
    for (char c : sentence) {
        if (c == ' ') {
            if (!word.empty()) {
                words.push_back(word);
                word = "";
            }
        } else {
            word += c;
        }
    }
    if (!word.empty()) {
        words.push_back(word);
    }

    vector<string> prime_words;
    for (const string& w : words) {
        if (is_prime(w.size())) {
            prime_words.push_back(w);
        }
    }

    string result = "";
    for (const string& pw : prime_words) {
        result += pw + " ";
    }
    if (!result.empty()) {
        result.pop_back(); // Remove the extra space at the end
    }

    return result;
}

