#include <iostream>
#include <string>
#include <vector>
#include <algorithm>

std::string anti_shuffle(std::string s) {
    std::vector<std::string> words;
    std::string word = "";
    for (char c : s) {
        if (c == ' ') {
            words.push_back(word);
            word = "";
        } else {
            word += c;
        }
    }
    words.push_back(word);

    std::vector<std::string> ordered_words;
    for (const std::string& w : words) {
        std::string ordered_word = w;
        std::sort(ordered_word.begin(), ordered_word.end());
        ordered_words.push_back(ordered_word);
    }

    std::string result = "";
    for (size_t i = 0; i < words.size(); i++) {
        result += ordered_words[i];
        if (i < words.size() - 1) {
            result += " ";
        }
    }

    return result;
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (anti_shuffle("Hi") == "Hi");
    assert (anti_shuffle("hello") == "ehllo");
    assert (anti_shuffle("number") == "bemnru");
    assert (anti_shuffle("abcd") == "abcd");
    assert (anti_shuffle("Hello World!!!") == "Hello !!!Wdlor");
    assert (anti_shuffle("") == "");
    assert (anti_shuffle("Hi. My name is Mister Robot. How are you?") == ".Hi My aemn is Meirst .Rboot How aer ?ouy");
}

