#include<stdio.h>
using namespace std;
int modp(int n, int p) {
    if (n == 0) {
        return 1;
    }
    int result = 1;
    int base = 2;
    n = n % (p - 1);  // Euler's theorem: a^(phi(m)) ≡ 1 (mod m) if a and m are coprime
    while (n > 0) {
        if (n % 2 == 1) {
            result = (result * base) % p;
        }
        base = (base * base) % p;
        n = n / 2;
    }
    return result;
