bool check_dict_case(map<string, string> dict) {
    if (dict.empty()) {
        return false;
    }
    for (const auto& pair : dict) {
        const string& key = pair.first;
        bool isLower = true;
        bool isUpper = true;
        for (char c : key) {
            if (!islower(c)) {
                isLower = false;
            }
            if (!isupper(c)) {
                isUpper = false;
            }
        }
        if (!isLower && !isUpper) {
            return false;
        }
    }
    return true;
}

#undef NDEBUG
