#include <iostream>
#include <string>
#include <sstream>

int is_bored(std::string S) {
    std::stringstream ss(S);
    std::string sentence;
    int boredom_count = 0;

    while (std::getline(ss, sentence, '.') || std::getline(ss, sentence, '?') || std::getline(ss, sentence, '!')) {
        sentence = sentence.substr(sentence.find_first_not_of(" "), sentence.find_last_not_of(" ") + 1);
        if (!sentence.empty()) {
            if (sentence.substr(0, 2) == "I ") {
                boredom_count++;
            }
        }
    }

    return boredom_count;
}

