int is_bored(string S) {
    int boredom_count = 0;
    size_t pos = 0;
    while (pos < S.length()) {
        size_t end_pos = S.find_first_of(".?!", pos);
        if (end_pos == string::npos) {
            end_pos = S.length();
        }
        string sentence = S.substr(pos, end_pos - pos);
        if (!sentence.empty()) {
            size_t word_pos = sentence.find(' ');
            if (word_pos != string::npos && sentence.substr(0, word_pos) == "I") {
                boredom_count++;
            }
        }
        pos = end_pos + 1;
    }
    return boredom_count;
}

