int is_bored(std::string S) {
    std::vector<std::string> sentences;
    std::string delimiter = ".?!";
    size_t start = 0;
    size_t end = S.find_first_of(delimiter);
    while (end != std::string::npos) {
        sentences.push_back(S.substr(start, end - start + 1));
        start = end + 1;
        end = S.find_first_of(delimiter, start);
    }
    sentences.push_back(S.substr(start));

    int boredom_count = 0;
    for (const std::string& sentence : sentences) {
        std::string trimmed_sentence = sentence;
        trimmed_sentence.erase(std::remove_if(trimmed_sentence.begin(), trimmed_sentence.end(), ::isspace), trimmed_sentence.end());
        if (trimmed_sentence.find("I") == 0) {
            boredom_count++;
        }
    }
    return boredom_count;
}

