bool is_nested(std::string str) {
    std::stack<char> stack;
    for (char c : str) {
        if (c == '[') {
            stack.push(c);
        } else if (c == ']' && !stack.empty() && stack.top() == '[') {
            stack.pop();
        }
    }
    return !stack.empty() && stack.size() < str.size() && stack.size() > 0;
}

