#include <string>
using namespace std;

string encode_shift(string s) {
    string out = "";
    for (char c : s) {
        int w = (c - 'a' + 5) % 26 + 'a';
        out += static_cast<char>(w);
    }
    return out;
}

string decode_shift(string s) {
    string out = "";
    for (char c : s) {
        int w = (c - 'a' - 5 + 26) % 26 + 'a';
        out += static_cast<char>(w);
    }
    return out;
}

#undef NDEBUG
#include<assert.h>
int main(){

    for (int i=0;i<100;i++)
    {
        int l=10+rand()%11;
        string str="";
        for (int j=0;j<l;j++)
        {
            char chr=97+rand()%26;
            str+=chr;
        }

        string encoded_str = encode_shift(str);
        assert (decode_shift(encoded_str) == str);
    }
}

