#include <vector>
#include <algorithm>
#include <string>

int digitSum(int num) {
    std::string numStr = std::to_string(num < 0 ? -num : num);
    int sum = 0;
    for (char digit : numStr) {
        sum += digit - '0';
    }
    return sum;
}

std::vector<int> order_by_points(std::vector<int> nums) {
    std::sort(nums.begin(), nums.end(), [&nums](int a, int b) {
        if (digitSum(a) == digitSum(b)) {
            return std::find(nums.begin(), nums.end(), a) - nums.begin() < std::find(nums.begin(), nums.end(), b) - nums.begin();
        }
        return digitSum(a) < digitSum(b);
    });
    return nums;
}

