#include <unordered_map>

std::vector<int> parse_music(std::string music_string) {
    std::unordered_map<std::string, int> notes_duration = {
        {"o", 4},
        {"o|", 2},
        {".|", 1}
    };

    std::vector<int> result;
    size_t pos = 0;
    while ((pos = music_string.find(" ")) != std::string::npos) {
        std::string note = music_string.substr(0, pos);
        result.push_back(notes_duration[note]);
        music_string.erase(0, pos + 1);
    }
    result.push_back(notes_duration[music_string]); // Last note

    return result;
}

