bool valid_date(string date) {
    if (date.empty()) {
        return false;
    }

    stringstream ss(date);
    vector<int> parts;
    string part;
    while (getline(ss, part, '-')) {
        try {
            parts.push_back(stoi(part));
        } catch (...) {
            return false;
        }
    }

    if (parts.size() != 3) {
        return false;
    }

    int month = parts[0];
    int day = parts[1];
    int year = parts[2];

    if (month < 1 || month > 12) {
        return false;
    }

    if (month == 2) {
        if (day < 1 || day > 29) {
            return false;
        }
    } else if (month == 4 || month == 6 || month == 9 || month == 11) {
        if (day < 1 || day > 30) {
            return false;
        }
    } else {
        if (day < 1 || day > 31) {
            return false;
        }
    }

    return true;
}

