std::string file_name_check(std::string file_name) {
    if (file_name.size() < 5) {
        return "No";
    }
    int dotCount = 0;
    int digitCount = 0;
    for (char c : file_name) {
        if (c == '.') {
            dotCount++;
        } else if (isdigit(c)) {
            digitCount++;
        }
    }
    if (dotCount != 1 || digitCount > 3) {
        return "No";
    }
    size_t dotPos = file_name.find('.');
    std::string name = file_name.substr(0, dotPos);
    std::string ext = file_name.substr(dotPos + 1);
    if (!isalpha(name[0]) || !(ext == "txt" || ext == "exe" || ext == "dll")) {
        return "No";
    }
    return "Yes";
}

