using namespace std;

vector<int> get_odd_collatz(int n) {
    auto collatz = [](int num) {
        vector<int> sequence = {num};
        while (num != 1) {
            if (num % 2 == 0) {
                num = num / 2;
            } else {
                num = 3 * num + 1;
            }
            sequence.push_back(num);
        }
        return sequence;
    };

    vector<int> collatz_sequence = collatz(n);
    vector<int> odd_numbers;
    for (int x : collatz_sequence) {
        if (x % 2 != 0) {
            odd_numbers.push_back(x);
        }
    }
    sort(odd_numbers.begin(), odd_numbers.end());
    odd_numbers.erase(unique(odd_numbers.begin(), odd_numbers.end()), odd_numbers.end());
    return odd_numbers;
}

