using namespace std;

#include <string>
#include <map>
#include <sstream>

std::map<char, int> histogram(std::string test) {
    std::map<char, int> letter_count;
    std::istringstream iss(test);
    std::string letter;

    while (iss >> letter) {
        for (char c : letter) {
            letter_count[c]++;
        }
    }

    int max_count = 0;
    for (const auto& pair : letter_count) {
        max_count = std::max(max_count, pair.second);
    }

    std::map<char, int> result;
    for (const auto& pair : letter_count) {
        if (pair.second == max_count) {
            result[pair.first] = pair.second;
        }
    }

    return result;
}

#undef NDEBUG
#include<assert.h>
bool issame(map<char,int> a,map<char,int> b){
    if (a.size()!=b.size()) return false;
    map <char,int>::iterator it;
    for (it=a.begin();it!=a.end();it++)
    {
        char w1=it->first;
        int w2=it->second;
        if (b.find(w1)==b.end()) return false;
        if (b[w1]!=w2) return false;
    }

    return true;
}
int main(){
    assert (issame(histogram("a b b a") , {{'a',2},{'b', 2}}));
    assert (issame(histogram("a b c a b") , {{'a', 2},{'b', 2}}));
    assert (issame(histogram("a b c d g") , {{'a', 1}, {'b', 1}, {'c', 1}, {'d', 1}, {'g', 1}}));
    assert (issame(histogram("r t g") , {{'r', 1},{'t', 1},{'g', 1}}));
    assert (issame(histogram("b b b b a") , {{'b', 4}}));
    assert (issame(histogram("r t g") , {{'r', 1},{'t', 1},{'g', 1}}));
    assert (issame(histogram("") , {}));
    assert (issame(histogram("a") , {{'a', 1}}));
}

