std::vector<int> make_a_pile(int n) {
    std::vector<int> stones = {n};
    for (int i = 1; i < n; i++) {
        if (n % 2 == 0) {
            n += 1;
        } else {
            n += 2;
        }
        stones.push_back(n);
    }
    return stones;
}

#undef NDEBUG
